import React from 'react';
import Button from 'react-bootstrap/Button';

function User() {
    let name = "John Doe";

    const changeName = () => {
        name = "Arvind B S";
    }
    return ( <div>
        <h2>Welcome {name}</h2>
        <button onClick={changeName()}>Change Name</button>
    </div> );
}

export default User;
